You can literally see the sand flying off the top of the sand dune and into my camera. I wasn’t prepared for this late summer storm in Colorado but I’m sure glad it happened. This is one my favorite landscape images of the West, I shot it 3 years ago. A true, right place at the right time kinda scenario. My favorite saying when it comes to camera gear in these scenarios is “tools not jewels.” Meaning it’s meant to be used and you gotta be willing to pull out the camera when the conditions turn to hell…. Or else what’s the point? On this night we got pelted by hail, drenched by rain and ultimately blasted by sand from Katabatic wind. And then at the end this rainbow appeared, almost a double. I’m certainly glad my camera was out, despite it taking a beating 

